import React from 'react';
import styled from 'styled-components';
import couple1 from '../images/couple.jpg';
import grossesse1 from '../images/grossesse.jpg';

const data = [
	{
		id: 1,
		picture: couple1,
		category: 'couple'
	},
	{
		id: 2,
		picture: grossesse1,
		category: 'pregnancy'
	}
];

const Galery = () => {
	return (
		<div>
			<div className="gallery">
				{data.map((photo, index) => (
					<PicContainer key={index}>
						<img src={photo.picture} alt={photo.category} style={{ height: '100%' }}/>
					</PicContainer>
				))}
			</div>
		</div>
	)
}

const PicContainer = styled.div`
	height: 250px;
	width: 250px;
`

export default Galery
